import "./SignUpPage.css";

const SignUpPage = () => {
  return (
    <div className="signuppage">
      <div className="div53">회원가입</div>
      <div className="div54">{`운동뭉치의 다양한 서비스를 경험해보세요 `}</div>
      <div className="div55">{`이름 `}</div>
      <div className="div56">비밀번호</div>
      <div className="div57">비밀번호 확인</div>
      <div className="div58">{`닉네임 `}</div>
      <div className="div59">{`아이디 `}</div>

      <div className="div60">{`중복확인 `}</div>
      <div className="div61">******</div>
      <div className="div62">******</div>
      <div className="div63">{`간편 회원가입 `}</div>
      <div className="signuppage-child6" />
      <img className="kakao-login-1-icon1" alt="" src="/kakao-login-1@2x.png" />
      <div className="div64">{`가입하기 `}</div>
    </div>
  );
};

export default SignUpPage;
